import { Toolbar,AppBar,Typography,Image } from '@material-ui/core';

const headerStyle = {
  padding: 20,
};

const Header = () => (

  <AppBar style={headerStyle} position="static">
    <Toolbar>
      <Typography variant="h6" >
        <Image src={{uri:'https://pigment.github.io/fake-logos/logos/large/color/fast-banana.png'}}></Image>
      </Typography>
    </Toolbar>
  </AppBar>
);

export default Header;
